def findMaxConsecutiveOnes(nums):
    maxtillnow = 0
    maxsofar = 0
    for i in nums:
        if(i == 1):
            maxtillnow = maxtillnow + 1
            # print(maxtillnow)
        else:
            maxsofar =  max(maxtillnow,maxsofar)
            maxtillnow = 0
                    # print(maxtillnow)
    return max(maxtillnow,maxsofar)

